※メーカー直送のため代金引換はお受けできません。<br> ※沖縄・一部離島は別途送料がかかります。お見積もりいたしますのでお問い合わせ下さい。<br>商品について：接触冷感敷きパッドシングル。しっとり柔らかく寝返りをうつ度にひんやり☆熱伝導率の高いポリエチレン素材を使っているので瞬間的に熱を奪い触った瞬間に冷たく感じます。繊維そのものに接触冷感機能があるので繰り返し洗濯しても効果が持続。毎日洗っても安心！清潔にお使いいただけます。<br>サイズ（cm）：幅100x奥行205cm・約0.74kg<br>材質：ポリエチレン60％・ポリエステル40％<br>完成品<br>日本製<br>(90400002)<style type="text/css">
